import React from "react";
import css from "./style.module.css";
const Order = (props) => {
  console.log(props.order);
  return (
    <div className={css.Order}>
      <p>
        Орц: Гахайн мах:{props.order.ingredients.bacon},Үхрийн мах{" "}
        {props.order.ingredients.meat}, Салад:
        {props.order.ingredients.salad}, Бяслаг:{props.order.ingredients.cheese}
        Хаяг:{props.order.address.name} | {props.order.address.street} |
        {props.order.address.city}
      </p>
      <p>
        Үнийн дүн: <strong>{props.order.price}₮</strong>
      </p>
    </div>
  );
};
export default Order;
